complexParameter.core:text:
def c = _.context.collector()

def geom = _.geom.find(position.p.first())
if (!geom) {
  _log.error('No geometry found')
  return
}

withTransformationContext {
	if(c.extent.value()){
		def ext= _.geom.bbox([c.extent.value(), geom])
		c.extent = ext
	}
	else {
		c.extent = geom
	}
}
targeom = _.geom.toSimpleGeometries(geometries:geom, collections:true)
return targeom
